import React from 'react';
import facebookLogo from '../../assets/icons/Facebook-logo.jpg';
import linkedinLogo from '../../assets/icons/linkedin-transparent.png';
import instagramLogo from '../../assets/icons/instagram-logo.png';
import githubLogo from '../../assets/icons/GitHub-Mark-Light-32px.png';
import '../../assets/styles/footer.css';

function Footer() {
    return (
        <footer className="p-6 flex items-center w-full h-20">
            <a href="https://linkedin.com/in/angela-man-b8533a6b/" target="_blank"><img src={linkedinLogo} alt="linked in logo" /></a>
            <a href="https://github.com/akman47" target="_blank"><img src={githubLogo} alt="github logo" /></a>
            <a href="https://instagram.com/superangieman"><img src={instagramLogo} alt="instagram logo" /></a>
            <a href="https://facebook.com/superangieman"><img src={facebookLogo} alt="facebook logo" /></a>
        </footer>
    )
}

export default Footer;
